} El código anterior, da como resultado: 18
segundo_numero = ¿triple_referencia? true El uso del operador sobre una variable & se denomina "referenciar". El uso del operador sobre una variable de referencia * se denomina " des referenciar". Rust usa dos reglas para las referencias mutables e inmutables. Son muy importantes y fáciles de recordar porque tienen sentido. Regla 1 : Si solo existen referencias inmutables a un valor, se pueden tener tantas como se quiera. Regla 2 : Si existe una referencia mutable a un valor, solo puede existir una referencia. Esto último significa que no pueden existir a la vez referencias inmutables y mutables en el mismo momento. Estas reglas son necesarias debido a que las referencias mutables pueden cambiar los datos. Sería problemático que se modificara un dato cuando otras referencias lo están usando. Un forma de entenderlo es pensar en la creación de una presentación de Powerpoint [1] . No se trata de un ejemplo excesivamente bueno, ya que actualmente es posible editar simultáneamente en Office 365. El primer caso representa el de la existencia de una referencia mutable : un empleado está editando una presentación de Powerpoint. Piode ayuda a su jefe. El empleado entrega sus credenciales de acceso a su jefe para que pueda editar el Powerpoint. Ahora el jefe tiene una "referencia mutable" a la presentación de su empleado. El jefe puede hacer los cambios que quiera y devolver el ordenador más tarde. Nadie más tiene acceso a la presentación, por lo que este caso no da problemas. El segundo caso representa el de **la existencia únicamente de referencias inmutables": El empleado entrega la presentación a 100 personas. Todas ellas pueden verla. Tienen una "referencia inmutable" a la presentación ya que nadie puede modificarla, por lo que este caso no da problemas. El tercer caso representa la situación problemática a evitar : El empleado entrega sus credenciales de acceso a su jefe, que a partir de aquí dispone de una "referencia mutable". Además, el empleado entrega la presentación a 100 personas. El jefe puede entrar a editar y estas modificaciones pueden verse o no por parte de las 100 personas, según el momento en que accedan sin que puedan controlar. Se puede ver que el intento de usar una referencia mutable simultáneamente con una inmutable no es aceptado por el compilador: fn main() { let mut numero = 10; let numero_ref = &numero; let numero_modif = &mut numero; *numero_modif += 10; println!("{}", numero_ref); // ⚠️
} El compilador muestra un mensaje explicativo muy claro para mostrar el problema: error[E0502]: cannot borrow `numero` as mutable because it is also borrowed as immutable --> src/main.rs:4:24 |
3 | let numero_ref = &numero; | ------- immutable borrow occurs here
4 | let numero_modif = &mut numero; | ^^^^^^^^^^^ mutable borrow occurs here
5 | *numero_modif += 10;
6 | println!("{}", numero_ref); // ⚠️ | ---------- immutable borrow later used here Sin embargo, este código sí funciona. ¿Por qué? fn main() { let mut numero = 10; let numero_modif = &mut numero; // referencia modificable *numero_modif += 10; // suma 10 let numero_ref = &numero; // referencia inmutable println!("{}", numero_ref); // imprime el valor referenciado
} Imprime 20 sin problemas. Funciona porque el compilador es suficientemente inteligente para comprender el código. Conoce que se ha cmabiado numero a través de la referencia numero_modif, pero después, esta referencia mutable no se vuelve a usar. Por eso no hay problema aquí. No se usan "a la vez" referencias inmutables y mutables (como sí pasaba en el caso anterior). En versiones anteriores de Rust, este código sí daba error, pero actualmente no lo hace ya que el compilador es más inteligente. Puede entender no solo lo que se ha tecleado, sino como se usa todo.

