Son los datos guardados dentro de corchetes: []. Los Arrays: No pueden cambiar de tamaño. Tienen datos del mismo tipo. Sin embargo, son muy rápidos. El tipo de un array es: [tipo; longitud]. Por ejemplo, el tipo de ["Uno", "Dos"] es [&str; 2]. Esto significa que los siguientes dos arrays tienen tipos diferentes: fn main() { let array1 = ["One", "Two"]; // Este es de tipo [&str; 2] let array2 = ["One", "Two", "Five"]; // Y este de tipo [&str; 3]. ¡Son dos tipos diferentes!
} Para conocer el tipo de una variable se puede "pedir" al compilador que haga algo con ella que no sea válido, por ejemplo: fn main() { let seasons = ["Spring", "Summer", "Autumn", "Winter"]; let seasons2 = ["Spring", "Summer", "Fall", "Autumn", "Winter"]; seasons.ddd(); // ⚠️ seasons2.thd(); // ⚠️ también
} El compilador dice, "¿Qué haces? No existe el método .ddd() para la variable seasons y tampoco existe el método .thd() para seasons2" como puedes ver: error[E0599]: no method named `ddd` found for array `[&str; 4]` in the current scope --> src\main.rs:4:13 |
4 | seasons.ddd(); // | ^^^ method not found in `[&str; 4]` error[E0599]: no method named `thd` found for array `[&str; 5]` in the current scope --> src\main.rs:5:14 |
